import React, { Component } from "react";

export default class Card extends Component {
  render() {
    return (
      <div>
        <div className="card">
          <p style={{ paddingLeft: "5%" }}>{this.props.title}</p>
          <hr className="horizontal_line" />
          }} />
          <div class="container">
            <h4>
              <b>John Doe</b>
            </h4>
            <p>Architect & Engineer</p>
          </div>
        </div>
      </div>
    );
  }
}
